import React, { useState } from 'react';
import '../Style/TableComponent.css';

const TableComponent = () => {
    // Sample data
    const [data, setData] = useState([
        { id: 1, name: 'Alice', age: 25, city: 'New York', country: 'USA' },
        { id: 2, name: 'Bob', age: 30, city: 'San Francisco', country: 'USA' },
        { id: 3, name: 'Charlie', age: 35, city: 'London', country: 'UK' },
        { id: 4, name: 'David', age: 40, city: 'Berlin', country: 'Germany' },
        { id: 5, name: 'Eva', age: 28, city: 'Paris', country: 'France' },
    ]);

    // State for new person data
    const [newPerson, setNewPerson] = useState({
        name: '',
        age: '',
        city: '',
        country: '',
    });

    // State to toggle form visibility
    const [isFormVisible, setIsFormVisible] = useState(false);

    // Function to handle input changes
    const handleChange = (e) => {
        const { name, value } = e.target;
        setNewPerson((prev) => ({
            ...prev,
            [name]: value,
        }));
    };

    // Function to handle adding a new person
    const addNewPerson = (e) => {
        e.preventDefault(); // Prevent the default form submission
        if (newPerson.name && newPerson.age && newPerson.city && newPerson.country) {
            setData((prev) => [
                ...prev,
                {
                    id: prev.length + 1, // Simple ID generation
                    ...newPerson,
                    age: parseInt(newPerson.age), // Convert age to a number
                },
            ]);
            setNewPerson({ name: '', age: '', city: '', country: '' }); // Reset form
            setIsFormVisible(false); // Hide form after submission
        } else {
            alert("Please fill out all fields."); // Simple validation
        }
    };

    return (
        <div>
            <h2>Sample Table</h2>
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Name</th>
                        <th>Age</th>
                        <th>City</th>
                        <th>Country</th>
                    </tr>
                </thead>
                <tbody>
                    {data.map(item => (
                        <tr key={item.id}>
                            <td>{item.id}</td>
                            <td>{item.name}</td>
                            <td>{item.age}</td>
                            <td>{item.city}</td>
                            <td>{item.country}</td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <div className="add-person">
                <button onClick={() => setIsFormVisible(prev => !prev)}>
                    {isFormVisible ? 'Hide Form' : 'Add New'}
                </button>
            </div>

            {/* New Person Form */}
            {isFormVisible && (
                <div>
                    <h3>Add New Person</h3>
                    <form onSubmit={addNewPerson}>
                        <input
                            type="text"
                            name="name"
                            placeholder="Name"
                            value={newPerson.name}
                            onChange={handleChange}
                            required
                        />
                        <input
                            type="number"
                            name="age"
                            placeholder="Age"
                            value={newPerson.age}
                            onChange={handleChange}
                            required
                        />
                        <input
                            type="text"
                            name="city"
                            placeholder="City"
                            value={newPerson.city}
                            onChange={handleChange}
                            required
                        />
                        <input
                            type="text"
                            name="country"
                            placeholder="Country"
                            value={newPerson.country}
                            onChange={handleChange}
                            required
                        />
                        <button type="submit">Add New</button>
                    </form>
                </div>
            )}
        </div>
    );
};

export default TableComponent;
